message:
[INTERNAL][FIX] sap.m.Toolbar: Info-CTX visual corrected

- Info Toolbar`s 
- (1) padding is according to the VD;
- (2) margin is removed according to the VD;
- (3) sap.m.Text now truncates (as defined in VD);

Change-Id: Icc5721fcdee2e7aab3be9919dedf227c239cdabe
BCP: 1770015657

- Change FormRedux submit button position strategy from absolute to fixed;
- Fix FormWidget fields page move up, move down and delete buttons focus layout;
- Fix FormWidget Menu component alignment layout;
- Fix FormWidget Fields page alignment layout;
- Fix FormWidget Form page alignment layout and overflow auto layout;
- Fix AutoFireFormPage overflow auto layout;
- Fix FormWidget Report page alignment layout;
- Add button no-focus layout into main.scss file.

Major upgrades and refactor on the unfollow_user definition

The same generic structure as its follow pair- follow_user definition.
Specifically notable changes are:
Checking page availablity is being held at get_following_status function;
So does the check of possible username change block is being held at get_following_status;
Lots of stability in action verification steps which are held at verify_action function;
Some refactored lines into shorter expressions;

Umple Template - {
* First delivery for umple as a template language. 
* Error messages will be added in next deliveries.
}

git-svn-id: 2ec2aa8503487039fbfec9ce2f71438cb8f15248@3660 6ebf9d09-8eb1-0036-9d08-68c07d1b990a

Reset render data when restarting in oculus_mobile;

Fixes a crash where rendering would occur with the old Lua state
after a restart.

Plug a memory leak

openscap-1.3.0_alpha1/src/OVAL/probes/crapi/digest.c:78: alloc_fn:
Storage is returned from allocation function "malloc".
openscap-1.3.0_alpha1/src/OVAL/probes/crapi/digest.c:78: var_assign:
Assigning: "ctbl" = storage returned from "malloc(num * 40UL)".
openscap-1.3.0_alpha1/src/OVAL/probes/crapi/digest.c:89: leaked_storage:
Variable "ctbl" going out of scope leaks the storage it points to.
   87|   	if (num <= 0 || fd <= 0) {
   88|   		errno = EINVAL;
   89|-> 		return -1;
   90|   	}
   91|           for (i = 0; i < num; ++i)
